.

El fiscal asignado para el caso del expresidente Álvaro Uribe Vélez, Gabriel Ramón Jaimes Durán, negó la petición elevada por la defensa para que se ordenara su libertad.
“El fiscal a cargo de la investigación rechazó la solicitud de libertad presentada por la defensa técnica del exsenador Álvaro Uribe Vélez porque este tipo de peticiones solamente deben ser conocidas y decididas en audiencias preliminares por un juez de control de garantías conforme a lo establecido por la ley 906 de 2004 que diseño el sistema penal acusatorio en Colombia”, señaló la Fiscalía en un comunicado.
 es la primera decisión que toma al respecto del caso Jaimes Durán, quien fue seleccionado este jueves para este proceso por parte del fiscal general de la Nación, Francisco Barbosa.
.
Además, luego de una primera revisión al proceso el fiscal evidenció que el asunto materia de investigación debe seguirse exclusivamente dentro de los parámetros de la Ley 906 de 2004, Sistema Penal Acusatorio, porque hace referencia a hechos que habrían ocurrido entre 2017 y 2018.
“La complejidad de la investigación y la dispendiosa documentación del expediente, exigirá que en los próximos días se haga un estudio del caso para definir un método de tránsito entre los dos sistemas procesales”, concluyó el comunicado.
.

